import './App.css';
import Video from "./components/Video";
import React, { useEffect } from 'react';
import axios from "./axios"

function App() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    async function fetchPosts() {
      const response = await axios.get("/v2/posts");
    }
  }, []);

  return (
    <div className="App">
      <h1>HEllo</h1>
      <Video />
      <Video />
    </div>
  );
}

export default App;
